import Search from '../comps/search';
const SideBar = props => (
  <div>
    <div className="sideBarBox">
        
        <Search className="seachBarMain"/>
    </div>

    <style jsx>{`
    .searchBarMain{
      position:fixed;
    }
    .sideBarBox{
    padding: 0;
    margin: 0;
    height: 100vh;
    color: #1DB954;
    background: black;
    position: fixed;
    width: 25%;
  }
    `}
    </style>
  </div>
);

export default SideBar;
